jQuery.fn.print=function(){if(this.size()>1){this.eq(0).print();return}else{if(!this.size()){return}}var e=("printer-"+(new Date()).getTime());var f=$("<iframe name='"+e+"'>");f.css("width","1px").css("height","1px").css("position","absolute").css("left","-9999px").appendTo($("body:first"));var b=window.frames[e];var a=b.document;var c=$("<div>").append($("style").clone());a.open();var d='<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml" lang="en"><html><head><title>'+document.title+"</title>"+c.html()+"</head><body id='printerDocument'>"+this.html()+"</body></html>";a.write(d);a.close();b.focus();b.print();setTimeout(function(){f.remove()},(60*1000))};